INSERT INTO `tbl_produk` (`id_produk`, `kd_produk`, `id_kategori`, `id_merek`, `judul`, `berat`, `deskripsi`, `harga_lama`, `harga`, `foto`, `foto1`, `foto2`, `foto3`, `foto4`, `status`, `jenis`, `stok`, `terjual`, `judul_seo`, `tglinput`) VALUES
(79, 'B01', 1, 50, 'Appel merah', '1 Kg', '<p><b></b>Apel&nbsp;adalah jenis buah-buahan, atau buah yang dihasilkan dari pohon buah apel. Buah apel&nbsp;biasanya berwarna merah kulitnya jika masak dan (siap dimakan), namun bisa juga kulitnya berwarna hijau atau kuning. ... Apel&nbsp;dimasak sampai lembek untuk dibuat saus apel. Apel&nbsp;juga dibuat untuk menjadi minuman sari buah apel.</p><p><br></p>', 30000, 24000, '20200613104503apel.webp', '', '', '', '', 'Y', 'Baru', '100', NULL, 'appel-merah', '2020-06-13'),
(80, 'S01', 2, 50, 'Sayur brokoli', '1 Kg', '<p><b></b>Brokoli&nbsp;(Brassica oleracea L. Kelompok Italica) adalah tanaman sayuran yang termasuk dalam suku kubis-kubisan atau Brassicaceae. ... Bagian brokoli&nbsp;yang dimakan adalah kepala bunga berwarna hijau yang tersusun rapat seperti cabang pohon dengan batang tebal.</p><p><br></p>', 38000, 36000, '20200613104648brokoli.jpg', '', '', '', '', 'Y', 'Baru', '100', NULL, 'sayur-brokoli', '2020-06-13'),
(81, 'S02', 2, 50, 'Wortel', '100 gram', '<p>Yaitu tumbuhan sayur yang ditanam dalam setahun penuh. ... Tumbuhan wortel&nbsp;mernbutuhkan cahaya matahari serta bisa turnbuh pada sernua musim. Wortel&nbsp;memiliki batang daun basah yang berbentuk sekumpulan pelepah (tangkai daun) yang nampak dari pangkal buah sisi atas (umbi akar), serupa daun seledri<br></p>', 9000, 7000, '20200613104747wortel.jpg', '', '', '', '', 'Y', 'Baru', '100', NULL, 'wortel', '2020-06-13'),
(82, 'P01', 17, 50, 'Susu Uht', '900 ml', '<p><b></b>Susu&nbsp;secara alami mengandung nutrisi penting, seperti bermacam-macam vitamin, protein, kalsium, magnesium, fosfor, dan zinc, pendapat lain menambahkan bahwa susu&nbsp;mengandung mineral dan lemak. Oleh karena itu, setiap orang dianjurkan minum susu.</p><p><br></p>', 16000, 15000, '20200613105422susu.jpg', '', '', '', '', 'Y', 'Baru', '100', NULL, 'susu-uht', '2020-06-13'),
(83, 'P02', 17, 50, 'Keju cheddar', '400 gram', '<p><b></b>Keju&nbsp;adalah sebuah makanan yang dihasilkan dengan memisahkan zat-zat padat dalam susu melalui proses pengentalan atau koagulasi. Proses pengentalan ini dilakukan dengan bantuan bakteri atau enzim tertentu yang disebut rennet. ... Air susu unta, kambing, domba, kuda, atau kerbau digunakan pada beberapa tipe keju&nbsp;lokal.</p><p><br></p>', 25000, 24000, '20200613105522keju.png', '', '', '', '', 'Y', 'Baru', '100', NULL, 'keju-cheddar', '2020-06-13'),
(84, 'K01', 7, 50, 'Roti Tawar SariRoti', '1 pcs', '<p><b></b>Roti tawar&nbsp;adalah salah satu produk roti&nbsp;yang terbuat dari bahan tepung terigu protein tinggi, air, yeast, lemak dan garam yang melalui proses peragian dengan ragi roti&nbsp;dan kemudian adonan roti&nbsp;dipanggang (Suburi, 2010).</p><p><br></p>', 16000, 15000, '20200613105651roti.jpg', '', '', '', '', 'Y', 'Baru', '100', NULL, 'roti-tawar-sariroti', '2020-06-13'),
(85, 'P03', 3, 50, 'Daging sapi', '100 gram', '<p><b>Daging sapi</b>&nbsp;(bahasa Inggris: beef) adalah <b>daging</b>&nbsp;yang diperoleh dari <b>sapi</b>&nbsp;yang biasa dan umum digunakan untuk keperluan konsumsi makanan. ... Selain itu ada beberapa bagian <b>daging sapi</b>&nbsp;lain seperti lidah, hati, hidung, jeroan dan buntut hanya digunakan di berbagai negara tertentu sebagai bahan dasar makanan.<br></p>', 24000, 25000, '20200613105840daging.jpg', '', '', '', '', 'Y', 'Baru', '100', NULL, 'daging-sapi', '2020-06-13'),
(86, 'Se01', 4, 50, 'Ikan tongkol', '1 Kg', '<p><b>Tongkol</b>&nbsp;(Euthynnus affinis) adalah sejenis <b>ikan</b>&nbsp;laut dari suku Scombridae. Terutama menjelajah di perairan dangkal dekat pesisir di kawasan Indo-Pasifik Barat, <b>tongkol</b>&nbsp;merupakan salah satu jenis <b>ikan</b>&nbsp;tangkapan yang penting bagi nelayan.<br></p>', 40000, 38000, '20200613105955ikan.jpg', '', '', '', '', 'Y', 'Baru', '100', NULL, 'ikan-tongkol', '2020-06-13');
